import {Grid, Cell} from 'react-mdl';

class AboutMe extends Component  {
  render (){
    return (
      <div style={{width:'100%', margin: 'auto'}}>
        <Grid className="aboutme-grid">
          <Cell col={12}>
            <img
              src= "https://freepngimg.com/thumb/wonder_woman/20973-1-wonder-woman-picture.png"
              alt='avatar'
              className='avatar-img'
              />
              <div className="banners-text" style={{marginTop: '30px'}}>
                <p>Hello, and welcome to my website. </p>

                <p>I am a full stack web developer, focus on implementing intricate and detailed code. I am passionate about building excellent websites that improves the lives of those around me. I absolutely love building user friendly websites and always ready to work on interesting projects.</p>

                <p>When I am not working, I love reading books, exploring different pages of the world, and hiking. </p>

              </div>

          </Cell>

        </Grid>
        <hr/>

        <footer style={{color:"grey"}}>
          Â© Tanuka Das. All rights reserved except the logos, which belong to the respective companies.
        </footer>

      </div>
    )
  }
}

export default AboutMe;
